import React, { useState, useEffect } from 'react';
import CVForm from './components/CVForm';
import JobRanking from './components/JobRanking';
import CvImprovements from './components/CvImprovements';
import { ReactComponent as Logo } from './logo.svg';

function App() {
  const [result, setResult] = useState(false); // just a flag for successful form submit
  const [error, setError] = useState(null);
  const [jobs, setJobs] = useState(null);
  const [cvImprovements, setCvImprovements] = useState(null);
  const [loading, setLoading] = useState(false);
  const [polling, setPolling] = useState(false);

  const fetchResults = async () => {
    setLoading(true);
    setError(null);
    try {
      const [improvementsRes, jobsRes] = await Promise.all([
        fetch('http://localhost:5002/api/improvements'),
        fetch('http://localhost:5002/api/jobrankings'),
      ]);
      if (!improvementsRes.ok || !jobsRes.ok) throw new Error('Failed to fetch results');
      const improvements = await improvementsRes.json();
      const jobs = await jobsRes.json();

      // Only set data if it's not empty and has actual content
      if (Object.keys(improvements).length > 0 && JSON.stringify(improvements) !== '{}') {
        setCvImprovements(improvements);
      }
      if (Object.keys(jobs).length > 0 && JSON.stringify(jobs) !== '{}') {
        setJobs(jobs);
      }
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  const startPolling = () => {
    setPolling(true);
    const pollInterval = setInterval(async () => {
      try {
        const [improvementsRes, jobsRes] = await Promise.all([
          fetch('http://localhost:5002/api/improvements'),
          fetch('http://localhost:5002/api/jobrankings'),
        ]);

        if (improvementsRes.ok && jobsRes.ok) {
          const improvements = await improvementsRes.json();
          const jobs = await jobsRes.json();

          // Check if both have data
          if (Object.keys(improvements).length > 0 && JSON.stringify(improvements) !== '{}' && 
              Object.keys(jobs).length > 0 && JSON.stringify(jobs) !== '{}') {
            setCvImprovements(improvements);
            setJobs(jobs);
            setPolling(false);
            clearInterval(pollInterval);
          }
        }
      } catch (err) {
        console.error('Polling error:', err);
      }
    }, 2000); // Poll every 2 seconds

    // Cleanup function
    return () => clearInterval(pollInterval);
  };

  const handleFormResult = () => {
    setResult(true);
    fetchResults(); // Initial fetch
    startPolling(); // Start polling for updates
  };

  return (
    <div className="min-h-screen w-full bg-gradient-to-br from-indigo-100 to-teal-50 py-4 md:py-12 font-sans">
      <div className="max-w-3xl mx-auto flex flex-col items-center justify-start min-h-screen">
        <div className="w-full max-w-md bg-white/70 rounded-3xl shadow-xl p-6 md:p-10 mb-8 flex flex-col items-center relative border border-white/30">
          <div className="mb-4 flex flex-col items-center">
            <Logo style={{ width: 56, height: 56, marginBottom: 8, filter: 'drop-shadow(0 2px 8px #a5b4fc)' }} />
          </div>
          <CVForm onResult={handleFormResult} onError={setError} />
          {error && (
            <div className="text-red-600 mt-2">{error}</div>
          )}
        </div>

        {loading && <div className="text-center text-lg text-gray-600">Loading results...</div>}

        {result && !loading && (
          <div className="w-full flex flex-col md:flex-row gap-6">
            <div className="w-full md:w-1/2 flex">
              <div className="bg-white/80 rounded-3xl shadow-xl p-4 flex-1 border border-white/30 hover:scale-[1.02] hover:shadow-2xl transition-transform">
                {jobs ? (
                  <JobRanking jobs={jobs} />
                ) : (
                  <div className="text-center py-8">
                    <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-indigo-600 mx-auto mb-4"></div>
                    <p className="text-gray-600">Waiting for job rankings...</p>
                  </div>
                )}
              </div>
            </div>
            <div className="w-full md:w-1/2 flex">
              <div className="bg-white/80 rounded-3xl shadow-xl p-4 flex-1 border border-white/30 hover:scale-[1.02] hover:shadow-2xl transition-transform">
                {cvImprovements ? (
                  <CvImprovements improvements={cvImprovements} />
                ) : (
                  <div className="text-center py-8">
                    <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-indigo-600 mx-auto mb-4"></div>
                    <p className="text-gray-600">Waiting for CV improvements...</p>
                  </div>
                )}
              </div>
            </div>
          </div>
        )}

        {polling && (
          <div className="text-center text-sm text-gray-500 mt-4">
            Polling for updates... Both improvements and rankings need to be posted.
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
